window.bookSummaryJSON = "<p>AU TEST</p> <p></p> <p>In the struggle between warring parents, who will protect the child?</p> <p>Garry Hartshorn and Softie Monaghan were never love's young dream. Not even on their wedding day.</p> <p>Softie was sophisticated, a career woman, who owned a nice apartment overlooking St Kilda Beach. Garry had a few rough edges, plus one failed marriage and an assortment of jobs under his belt. But Softie's body clock was ticking, and Garry wanted children....</p> <p>So they got married and produced the only thing they ever had in common: Matilda.</p> <p>Now, two years later, their golden-haired child is at the centre of a bitter divorce and custody battle. Both parents insist that her well-being is the only thing they care about. Yet, in truth, Matilda was always the one most likely to become lost.</p>"; 
